import 'bootstrap/dist/css/bootstrap.min.css';

class ProductLinkedList extends Component{
    render() {
        return(
            <div id="product-linked-list">
                <h4>This is our products (using linked lists)</h4>
            </div>

        );
    }
}
export default ProductLinkedList;
